// import * as api from '@/api/system/processMonitor'
export default {
  name: 'dialogStart',
  components: {},
  data: function data() {
    return {
      dialogVisible: false,
      formData: {
        processDefinitionKey: null,
        activityId: null,
        businessKey: null,
        processTitle: ''
      },
      tableTitle: [{
        label: '变量号',
        prop: 'id',
        width: '',
        colType: 'value'
      }, {
        label: '变量名',
        prop: 'name',
        width: '',
        colType: 'value'
      }, {
        label: '变量类型',
        prop: 'type',
        width: '',
        colType: 'value'
      }, {
        label: '变量值',
        prop: 'value',
        width: '',
        colType: 'input'
      }],
      propsArr: []
    };
  },
  methods: {
    initForm: function initForm(data) {
      console.log(data, 66666);
      this.formData.activityId = data.id;
      this.formData.processDefinitionKey = data.key;
      this.formData.processTitle = data.name + data.key;
      this.propsArr = data.variableList;
    },
    //发起流程
    startWorkFlow: function startWorkFlow() {
      var props = {};
      this.propsArr.forEach(function (item) {
        props["\"".concat(item.id, "\"")] = item.value;
      });
      this.formData.variables = props;
      this.$emit('startWorkFlow', this.formData);
    }
  }
};
